function GetService(props) {
  return (
    <div className="GetService">
      <Container>
        <Row>
          <Col md={12}>
            <p className="RegularParagraph">Some happy faces</p>
            <h3 className="SectionHeading">Real Happy Customers, Real Stories</h3>
          </Col>
          <Col md={12}>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default GetService;
